def intersect(rectangle_a, rectangle_b):

    if rectangle_a.nw.lon > rectangle_b.se.lon:
        # a's LHS is to the right of b's RHS
        return False
    if rectangle_a.se.lon < rectangle_b.nw.lon:
        # a's RHS is to the left of b's LHS
